import './App.css';
import Header from "./Header"
import FileIcons from './components/FileIcons';
import FileUpload from './components/FileUpload';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
      <Header />
      <Route path="/" element={
        <div className="body">
          <FileUpload />
          <FileIcons />
        </div>
      }/>
      </Router>
    </div>
  );
}

export default App;
